800 mins &       3 &      19\\\\\n\\end{tabular}\n","text/plain":"  ride_length_chunk count_member count_casual\n1 0 to 300 mins     3262666      1947857     \n2 300 to 600 mins      1229         1986     \n3 600 to 900 mins       340          881     \n4 900 to 1200 mins      262          763     \n5 1200 to 1500 mins    1495         6320     \n6 1500 to 1800 mins       3           19     "},"metadata":{}}]},{"cell_type":"markdown","source":"Above table shows that while majority of member and casual ride length is towards the mean of data (13.21 minutes for member riders and 26.35 minutes for casual riders), there are few instances of higher ride length. Casual riders have significantly higher number in higher ride length (member riders have 3 rides greater than 1500 minutes of ride length while casual riders have 19 rides greater than 1500 minutes of ride length ). The variance in count of ride length follows the pattern of standard deviation (36.65 mins for members and 91.22 mins for casual riders).","metadata":{}},{"cell_type":"markdown","source":"# Act Phase","metadata":{}},{"cell_type":"markdown","source":"Recommendations based on analysis:\n1. Create targetted campaigns for weekends and long length rides.\n2. Discounts for early morning rides and off peak hour rides.\n3. Campaigns for winter months like providing discounted winter gear rentals.\n4. Promoting the use of electric bikes for long rides by increasing the charge stations and discountings.\n5. Special discounts and campaigns during off peak months for long rides.\n6. Loyalty points for regular use of bikes for members.\n7. Allocating more classic bikes on weekends on popular stations and electric bikes during weekdays.\n8. Offer group or family discounts for weekends for members so the casual riders can consider getting membership.\n","metadata":{}}]}